Total Training - Microsoft Outlook 2010

Are you under the impression that Outlook is about e-mail? Well, youre not wrong but if thats all you think it is you are far from being fully accurate! Outlook is a personal information management system that allows you to create, organize and manage information. In this series you will learn how to fully utilize the extensive capabilities of Outlook, allowing you to better manage your information and your time. Youll learn there's more to e-mail, calendars, contacts, tasks and notes than just Send or Save including a whole set of tools that will make you more efficient and professional by integrating information in one place and using a common set of tools

Highlights

Learn to setup profiles and configure e-mails so you can track all communications in one place

Extend your view of what can be done with e-mail and how it can look

Discover the benefits of keeping an electronic calendar including the ability to easily setup meetings and share it with others

Keep all your contact information with all the details and automate uses of that information

Keep a list of tasks you need to accomplish

Use folders, junk mail and rules to automate and organize information

Organize all of your information in one single place with a common set of tools that allow you to be efficient, effective and professional

